import "../styles/header.css"
import {SubNavTab, Tab} from "./tab";
import $ from "jquery"

let page;
$(
    $("nav li a").hover(function() {
        page = "."+$(this).data("page");
        $(page).addClass("active")
    }, function() {
        $(page).removeClass("active");
    })
)

function Header() {
    return <div className="header">

        <div className="logo-div">
            {/* TODO: Agregar logo de Imagen Sistemas */}
            <img className="logo-img" src="https://media.discordapp.net/attachments/925928236481912839/1033218814072061962/cadena-de-bloques.png" alt="IMG-SIS"/>
        </div>

        <div className="navigation-bar">
            <Tab page="INICIO"/>
            <Tab page="QUIENES SOMOS"/>
            <Tab page="EVENTOS"/>
            <SubNavTab page="CLUBES"/>
            <SubNavTab page="SERVICIOS"/>
            <Tab page="CONTACTO"/>
        </div>
    </div>
}

export default Header;
